import { Users } from "../Users/users";

export const Row = () => {
  return Users.map((user) => {
    return (
      <tr>
        <td className="userId, cell">{user.id}</td>
        <td className="userName, cell">{user.name}</td>
        <td className="userTime, cell">{user.time}</td>
        <td className="userDescription, cell">{user.description}</td>
        <td className="userDone, cell">{user.done}</td>
      </tr>
    );
  });
};
